import dynamic from "next/dynamic"
import { useState } from 'react'


const Rust = dynamic({
  loader: async () => {
    const rust = await import('../pkg/')
    const [board, setBoard] = useState([])

    return (
      (props) => {
        return (
          <>
            <input onChange={e => setBoard(e.target.value)} />
            <div></div>
          </>
        )
      })
  },
})

export default Rust
